function copyToClipboard(e){var t=document.querySelector("#"+e);t.select();try{var c=document.execCommand("copy"),n=c?"successful":"unsuccessful";alert("Copying text command was "+n)}catch(o){alert("Oops, unable to copy")}}function printValue(e,t){document.getElementById(t).value=e}function emptyTag(e){$("#"+e).empty(),document.getElementById(e).value=""}$("#reset-text").click(function(){emptyTag("text")});